1. Pin Configuration The servo was connected to GPIO 13. Additionally, GPIOs 36, 35, and 1 were set to always output HIGH to stabilize auxiliary components. // Pin definitions
#define SERVO_PIN 13
#define SERVO_HIGH_1 36
#define SERVO_HIGH_2 35
#define GPIO_HIGH_1 1 2. PWM Timer Configuration A PWM signal with a frequency of 50Hz (20ms period) was used to control the servo motor. The timer was set to 14-bit resolution, allowing a duty cycle range of 0 to 16383. ledc_timer_config_t ledc_timer = { .speed_mode = PWM_MODE, .duty_resolution = PWM_RESOLUTION, .timer_num = PWM_TIMER, .freq_hz = PWM_FREQ, .clk_cfg = LEDC_AUTO_CLK
};
esp_err_t timer_err = ledc_timer_config(&ledc_timer); 3. Duty Cycle Calculation The pulse width for the servo was calculated based on the desired angle, mapped to the servo’s minimum and maximum pulse widths (544µs to 2400µs). The calculated pulse width was converted to the appropriate duty cycle for the PWM signal. Mathematically: Pulse Width (µs)=SERVO_MIN_PULSEWIDTH+(180SERVO_MAX_PULSEWIDTH−SERVO_MIN_PULSEWIDTH​⋅Angle) Duty Cycle=PWM Period (µs)Pulse Width (µs)⋅Max Resolution​ For example: At 0°: Pulse width = 544µs, duty = 445. At 180°: Pulse width = 2400µs, duty = 1966. 4. Angle Testing The setServoAngle function was implemented to move the servo to specified angles between 0° and 180°: void setServoAngle(uint8_t angle) { // Convert angle to pulse width uint32_t pulseWidth = SERVO_MIN_PULSEWIDTH + (((SERVO_MAX_PULSEWIDTH - SERVO_MIN_PULSEWIDTH) * angle) / 180); // Convert pulse width to duty cycle uint32_t duty = (uint32_t)((float)pulseWidth * 16383.0f / 20000.0f); // Update duty cycle ledc_set_duty(PWM_MODE, PWM_CHANNEL, duty); ledc_update_duty(PWM_MODE, PWM_CHANNEL);
} The loop function tested the full range of motion by moving the servo to angles 0°, 45°, 90°, 135°, and 180°, pausing 2 seconds between each move.
